prompt --application/deployment/install/install_package
begin
wwv_flow_imp_shared.create_install_script(
 p_id=>wwv_flow_imp.id(24768254160294316)
,p_install_id=>wwv_flow_imp.id(89917235329349793)
,p_name=>'Package'
,p_sequence=>10
,p_script_type=>'INSTALL'
,p_script_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'create or replace package shopping_cart_api is',
'    ----------------------------------------------------------',
'    procedure clear_cart;',
'    ----------------------------------------------------------',
'    function add_item(',
'        p_item_code    in varchar2,',
'        p_quantity     in number,',
'        p_need_by_date in date)',
'    return varchar2;',
'    ----------------------------------------------------------',
'    procedure remove_item (',
'        p_item_id in varchar2);',
'    ----------------------------------------------------------',
'    procedure update_item (',
'        p_item_id      in varchar2,',
'        p_item_code    in varchar2,',
'        p_quantity     in number,',
'        p_need_by_date in date);',
'end shopping_cart_api;',
'/',
'create or replace package body shopping_cart_api is',
'    c_collection_name constant varchar2(40) := ''SHOPPING_CART'';',
'    ----------------------------------------------------------',
'    procedure ensure_collection',
'    is',
'    begin',
'        if not apex_collection.collection_exists(c_collection_name) then',
'            apex_collection.create_collection(c_collection_name);',
'        end if;',
'    end ensure_collection;',
'    ----------------------------------------------------------    ',
'    procedure clear_cart',
'    is',
'    begin',
'        ensure_collection;',
'        apex_collection.truncate_collection(c_collection_name);',
'    end clear_cart;',
'    ----------------------------------------------------------',
'    function get_seq_id(',
'        p_item_id in varchar2)',
'    return number',
'    is',
'        l_ret number;',
'    begin',
'        for j in (select seq_id as seq',
'                    from apex_collections',
'                   where collection_name = c_collection_name',
'                     and c002 = p_item_id)',
'        loop',
'            l_ret := j.seq;',
'        end loop;',
'        return l_ret;',
'    end;',
'    ----------------------------------------------------------',
'    function add_item (',
'        p_item_code    in varchar2,',
'        p_quantity     in number,',
'        p_need_by_date in date)',
'    return varchar2',
'    is',
'        l_ret varchar2(255) := sys_guid();',
'    begin',
'        ensure_collection;',
'        apex_collection.add_member (',
'            p_collection_name    => c_collection_name,',
'            p_c001               => p_item_code,',
'            p_c002               => l_ret,',
'            p_n001               => p_quantity,',
'            p_d001               => p_need_by_date',
'        );',
'        return l_ret;',
'    end add_item;',
'    ----------------------------------------------------------',
'    procedure remove_item (',
'        p_item_id in varchar2) ',
'    is',
'        l_seq_id number;',
'    begin',
'        ensure_collection;',
'        l_seq_id := get_seq_id(p_item_id);',
'        if l_seq_id is not null then',
'            apex_collection.delete_member (',
'                p_collection_name => c_collection_name,',
'                p_seq             => l_seq_id);',
'        end if;',
'    end remove_item;',
'    ----------------------------------------------------------',
'    procedure update_item (',
'        p_item_id      in varchar2,',
'        p_item_code    in varchar2,',
'        p_quantity     in number,',
'        p_need_by_date in date)',
'    is',
'        l_seq_id number;',
'    begin',
'        ensure_collection;',
'        l_seq_id := get_seq_id(p_item_id);',
'        if l_seq_id is not null then',
'            apex_collection.update_member(',
'                p_collection_name => c_collection_name,',
'                p_seq             => l_seq_id,',
'                p_c001            => p_item_code,',
'                p_c002            => p_item_id,',
'                p_n001            => p_quantity,',
'                p_d001            => p_need_by_date);',
'        end if;',
'    end update_item;',
'end shopping_cart_api;',
'/'))
);
wwv_flow_imp_shared.create_install_object(
 p_id=>wwv_flow_imp.id(24768317087294332)
,p_script_id=>wwv_flow_imp.id(24768254160294316)
,p_object_owner=>'#OWNER#'
,p_object_type=>'PACKAGE'
,p_object_name=>'SHOPPING_CART_API'
);
end;
